INSERT INTO `videos` (`video_id`, `title`, `description`, `upload_date`, `user_id`, `verified`, `video_file`) VALUES
(1, 'Abjad Bahasa Indonesia', 'Video untuk belajar mengenali angka dan huruf untuk anak-anak. Huruf B, B untuk Bola, B untuk Buku, B untuk Balon.\r\n', '2024-06-01 15:40:00', 1, 2, ''),
(2, 'Mengenal Warna | BaLiTa', 'Pengenalan berbagai warna dalam bentuk visual yang menarik.', '2024-06-01 14:00:00', 1, 2, ''),
(3, 'Balita - Kata Pertama', 'Membantu bayi atau balita anda belajar dengan cara yang menyenangkan, dan tentunya tontonan yang berkualitas untuk meningkatkan tumbuh kembang bayi atau balita anda.', '2024-06-03 11:00:00', 1, 2, ''),
(4, 'BELAJAR WARNA Lagu Anak', 'Hey Blovers! Mari mulai belajar mengenali warna-warni dengan objek sekitar kita. Video edukasi warna ini dikemas dengan cara lagu yang bikin mudah diingat dan membuat hidup penuh warna-warni :)', '2024-06-04 00:30:00', 2, 2, ''),
(5, 'ABC LETTERS in Indonesian', 'LEARNING TO KNOW ABC LETTERS in Indonesian\r\nLEARNING TO KNOW ABC LETTERS in Indonesian is a learning educational video for toddlers', '2024-06-04 23:33:00', 2, 1, ''),
(6, 'Mengenal Kata - Kak Nisa\r\n\r\n', 'Ajak bayi atau balita Anda belajar dengan kami! Dalam video ini kami akan mendorong pertumbuhan dan perkembangan otak bayi Anda. Bayi dapat menonton dan belajar sementara orang tua juga dapat mempelajari cara terbaik untuk bermain, berinteraksi, dan mendorong anak untuk belajar dan berkembang.', '2024-06-06 15:40:00', 2, 2, ''),
(7, 'Episode Spesial - Belajar Kata', 'Membantu bayi atau balita anda belajar dengan cara yang menyenangkan, dan tentunya tontonan yang berkualitas untuk meningkatkan tumbuh kembang bayi atau balita anda.', '2024-06-07 13:00:00', 3, 1, ''),
(8, 'Belajar Warna', 'Warna adalah langkah awal bagi anak-anak untuk mengamati, mempelajari, serta mengelompokkan apa yang mereka lihat. Karakter atau ciri yang mudah dikenal ini merangsang anak-anak untuk menjelaskan dan mengatur dunia di sekeliling mereka yang penuh dengan keragaman. Selain warna, di dalam video ini anak-anak juga belajar tentang nada dan musik sederhana.', '2024-06-07 21:30:00', 3, 2, ''),
(9, 'Belajar Bersama Kak Nisa', 'Ajak balita Anda belajar dengan kami! Dalam video ini kami akan mendorong pertumbuhan dan perkembangan otak balita Anda. Balita dapat menonton dan belajar sementara orang tua juga dapat mempelajari cara terbaik untuk bermain, berinteraksi, dan mendorong anak untuk belajar dan berkembang.', '2024-06-09 02:00:00', 3, 1, ''),
(10, 'Angka 1-100 | CilukPa', 'Hi, Cilukpers! Sekarang kita mulai belajar berhitung, ya. Kita awali dengan mengenal bilangan dari angka satu sampai angka seratus. Ok?\r\n\r\nSelamat belajar berhitung bersama CilukPa!\r\n', '2024-06-10 03:00:00', 4, 2, ''),
(11, 'Balon Berwarna-warni ', 'Warna dan bentuk adalah langkah awal bagi anak-anak untuk mengamati, mempelajari, serta mengelompokkan apa yang mereka lihat. Karakter atau ciri yang mudah dikenal ini merangsang anak-anak untuk menjelaskan dan mengatur dunia di sekeliling mereka yang penuh dengan keragaman.\r\n\r\n', '2024-06-10 20:33:00', 4, 2, ''),
(12, 'Belajar Bicara - Kak Nisa ', 'Membantu balita anda belajar dengan cara yang menyenangkan, dan tentunya tontonan yang berkualitas untuk meningkatkan tumbuh kembang balita anda', '2024-06-12 03:10:00', 4, 1, ''),
(13, 'Petualangan Alfabet', 'Orang tua juga akan menikmati video pembelajaran kami yang dibuat untuk anak-anak dengan lagu prasekolah, kartun lucu & lagu pengantar tidur populer. Anak-anak prasekolah, balita, dan bayi dapat belajar huruf, angka, suara binatang, warna, bentuk & lainnya!', '2024-06-13 03:30:00', 5, 2, ''),
(14, 'Mengenal Bentuk | CilukPa\r\n', 'Hi, Cilukpers! Kali ini kita akan belajar mengenal bentuk, ya! Mulai dari segi tiga, segi empat, lingkaran dan masih banyak lagi! \r\n\r\nSelamat belajar mengenal bentuk bersama CilukPa!\r\n', '2024-06-14 15:10:00', 5, 1, ''),
(15, 'Kata Pertama - Kak Nisa', 'Ajak bayi atau balita Anda belajar dengan kami! Dalam video ini kami akan mendorong pertumbuhan dan perkembangan otak bayi Anda. Bayi dapat menonton dan belajar sementara orang tua juga dapat mempelajari cara terbaik untuk bermain, berinteraksi, dan mendorong anak untuk belajar dan berkembang.', '2024-06-15 00:30:00', 5, 2, ''),
(16, 'Lagu Menghitung Angka', 'Mendengarkan pantun selalu merupakan tur yang menyenangkan lagu Junior Squad dan cerita anak-anak karena membawa Anda ke dunia imajinasi terbaik, baik itu cerita pengantar tidur. ', '2024-06-15 22:30:00', 6, 1, ''),
(17, 'Warna dan Lainnya', 'Diciptakan untuk Balita', '2024-06-17 12:00:00', 6, 2, ''),
(18, 'Nama Hewan - Kak Nisa', 'Membantu balita anda belajar dengan cara yang menyenangkan, dan tentunya tontonan yang berkualitas untuk meningkatkan tumbuh kembang balita anda.', '2024-06-17 23:40:00', 6, 1, ''),
(19, 'Baby Shark Angka & Huruf\r\n', 'Anda sedang nonton kumpulan lagu baby shark - belajar angka dan huruf dari Pinkfong dan Baby Shark. Nikmati lagu-lagu pendidikan dan cerita untuk anak-anak prasekolah yang dibuat oleh para ahli dalam pendidikan anak-anak.', '2024-06-18 17:30:00', 7, 1, ''),
(20, 'Warna | CilukPa', 'Hi CilukPers! Kali ini kita akan belajar mengenal warna, yuk! Sambil mengingat warna-warna buah-buahan.\r\n\r\nDi video ini kita akan belajar mengenal warna-warna, dari warna merah, kuning, hijau dan masih banyak warna-warna lainnya. Selamat belajar!\r\n', '2024-06-20 13:10:00', 7, 1, ''),
(21, 'Kepala Pundak Lutut Kaki', 'Teman teman,\r\nSekarang saatnya kita menari bersama. Kali ini bersama dengan \r\nadik Jeanete !\r\n\r\nYuk menari sambil bernyanyi lagu\r\nKepala Pundak lutut kaki\r\n\r\nKepala pundak lutut kaki lutut kaki\r\ndaun telinga mata hidung dan pipi\r\n', '2024-06-21 05:00:00', 7, 2, ''),
(22, 'Angka 1-5 - Yufid Kids', 'Serial Mengenal Angka : Mengenal Angka 1-5 (Tema: Laut) - Yufid Kids \r\n\r\nSerial baru bagi teman-teman semua … Apa itu? Ya … Mengenal Angka! Subhanallah … Kali ini Nisa mengajak teman-teman untuk menjelajah lautan dengan ditemani Kapal Selam milik Profesor. Kayak apa serunya? Penasaran kan? \r\n', '2024-06-21 20:50:00', 8, 2, ''),
(23, 'Warna - Yufid Kids', 'Video edukasi anak kali ini adalah video belajar mengenal warna untuk anak tk ataupun anak usia dini. Selain belajar mengenal warna bahasa Indonesia, video mengenal warna warna ini juga mengajak anak untuk mengenal warna dalam bahasa Arab. Anak-anak akan belajar mengenal warna dasar dan warna-warna lainnya melalui benda-benda yang ada di lingkungan sekitar.', '2024-06-23 16:40:55', 8, 2, ''),
(24, 'Kucing Tiga Gemuk', 'Kucingku Tiga Gemuk\r\n\r\nKucingku tiga.\r\nSemuanya gemuk.\r\nYang satu merah.\r\nYang dua kelabu.\r\n\r\nMeong meong.\r\nKuberi makan ikan.\r\nKucingku kenyang.\r\nHatiku senang.\r\n', '2024-06-23 23:50:30', 8, 2, ''),
(25, 'Membaca Kata | CilukPa', 'Hi, Cilukpers! Setelah kita belajar membaca huruf alfabet, sekarang kita lanjutkan dengan belajar membaca satu suku kata, yuk! Agar kita semakin lancar membaca dalam Bahasa Indonesia, ya!', '2024-07-24 02:30:10', 8, 2, ''),
(31, 'Serial Mengenal Angka : Mengenal Angka 6-10 (Tema: Hutan) - Yufid Kids', 'Angka : Mengenal Angka 6-10 (Tema: Hutan) - Yufid Kids \r\n\r\nSerial baru bagi teman-teman semua … Apa itu? Ya … Mengenal Angka! Subhanallah …', '2024-06-30 15:50:00', 1, 2, ''),
(32, 'Belajar Mengenal Bentuk untuk Anak - Yufid Kids', 'Video edukasi anak kali ini adalah video belajar mengenal bentuk untuk anak tk ataupun anak usia dini. Selain belajar mengenal bentuk bahasa Indonesia, video mengenal bentuk bentuk ini juga mengajak anak untuk mengenal bentuk dalam bahasa Arab. ', '2024-06-30 16:40:55', 1, 1, ''),
